import { configureStore } from '@reduxjs/toolkit';
import { counterSlice } from './slice';

export default configureStore({
    reducer: {
        counter: counterSlice.reducer,
        counter2: counterSlice.reducer,
        counter3: counterSlice.reducer,
    }
})
